    if mibBuilder.loadTexts: ciscoCatOSAclQosMIB.setRevisionsDescriptions(('Add the following groups: caqDownloadClassifierGroup, caqIpOperClassifierGroup, caqSecurityDownloadAclInfoGroup, caqSecurityDownloadIpAceGroup, caqIfDownloadAclMapGroup, caqIfIpPhoneMapGroup, caqArpLoggingSourceGroup, caqIpAceTypeGroup.', "Add 'include' enumeration value for caqSecurityAction. Add caqQosL3StatsRateGroup, caqQosL3StatsPeakGroup, caqAggPolicerOctetsRateGroup, caqAggPolicerPacketsRateGroup, caqAggPolicerOctetsPeakGroup, caqAggPolicerPacketsPeakGroup, caqQosPortRateGroup, caqQosPortPeakGroup, caqSecurityActionDnldAceGroup.", "Add 'matchEapoudp' and 'matchUrlRedirect' enum value for caqIpProtocolMatchCriteria object.", 'Add the following groups to support ACL hit count configuration and statistics: caqAclFeatureGroup caqAclHitCountGroup Add the following groups to support additional matching criteria for MAC ACE and MAC packet classify feature on VLAN: caqMacAceExtGroup. caqMacPktClassifyVlanGroup.', 'Add the following objects to support group name for source and destination fields in caqIpAceTable: caqIpAceSrcGroup caqIpAceDestGroup.', 'Add caqIfSecurityAclConfigGroup to support port ACL.', 'Add the dhcpSnooping bit for caqSecurityRateLimitFeatures object. Fix a typo in the DESCRIPTION clause for caqSecurityAction object.', 'Deprecate caqSecurityRedirectPortList object and add caqSecurityRedirect2kPortList to support up to 2048 bridge ports.', 'Add the following objects and tables: caqClassifierMapDirection, caqIpAceSecurityId, caqDscpRewriteEnabled, caqAggPolicerOctets, caqAggPolicerNRExceedOctets, caqAggPolicerERExceedOctets, caqDscpMutationMapTable, caqVlanMutationIdMapTable, caqQosDefaultActionTable.', 'Add the caqLoggingGroup, caqArpInspGroup and caqSecurityRateLimitGroup to support security ACL logging, security ACL features rate limit and ARP Inspection device configuration.', 'Add the caqIfTrustDeviceGroup and caqQosExcessBurstGroup to support Qos information on excess burst size and trusted device configuration.', 'Add the caqPbfObjects group and modify the caqSecurityActionTable to support policy based forwarding.', 'Add the following objects: caqAggPolicerName, caqAggPolicerPackets, caqAggPolicerNRExceedPackets, caqAggPolicerERExceedPackets.', 'Initial version of this MIB module.',))
