if mibBuilder.loadTexts: caqSecurityAction.setStatus('current')
if mibBuilder.loadTexts: caqSecurityAction.setDescription('Determines the action that the device will take if the traffic matches the ACE. If permit(1) is specified, the matched traffic will be allowed through the device. If deny(2) is specified, the matched traffic will be blocked and dropped. If redirect(3) is specified, the matched traffic will be redirected to physical port(s) which should be configured in the caqSecurityRedirectPortList object. Redirect means taking packet coming in and putting it out of port(s) as is. If redirectWithAdj(4) is specified, the matched traffic will be redirected to the VLAN configured in the adjacency entry denoted by caqSecurityAdjIndex. If denyWithLog(5) is specified, the matched traffic will be blocked, dropped and logged. If denyArpInspection(6) is specified, the matched ARP traffic will be blocked and dropped. If denyArpInspWithLog(7) is specified, the matched ARP traffic will be blocked, dropped and logged. If permitArpInspection(8) is specified, the matched ARP traffic will be allowed through the device. if include(9) is specified, the matched trafic will be regulated according to the downloaded ACE type denoted by caqSecurityDownloadedAceFeature object.')
